import React from 'react'

var stylingObject = {
    container: {
        width: "100%",
        height: "70px",
        background: "#FFFFF3",
        display: "flex"
    },
    linksContainter: {
        background: "yellow"
    },
    logoContainer: {
        background: "red",
        width: "70px",
        height: "70px",
    }
}

function HomeNav() {
    return (
        <div style = {stylingObject.container}>
            <div style={stylingObject.logoContainer}></div>
            <div style={stylingObject.linksContainter}></div>
        </div>
    )
}

export default HomeNav
